        MainWindow.setWindowTitle(_translate("MainWindow", "CoreCycler"))
        self.general_treatWheaWarningAsError_checkBox.setToolTip(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\"># Treat a WHEA Warning Event Log entry as an error. If this is enabled, a WHEA warning (Event Id 19, &quot;corrected hardware error&quot;) will be treated as a &quot;real&quot; error. The testing on the core will be stopped and continued on the next one.</span></p><p align=\"center\"><span style=\" font-size:8pt;\">However, only if the APIC ID from the WHEA message matches the core that was currently tested, otherwise only a warning will be displayed.</span></p><p align=\"center\"><span style=\" font-size:8pt;\">Default is Enabled</span></p></body></html>"))
        self.general_treatWheaWarningAsError_checkBox.setText(_translate("MainWindow", "Treat WHEA As Error"))
        self.general_beepOnError_checkBox.setToolTip(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\">Plays a beep when a core has thrown an error.</span></p><p align=\"center\"><span style=\" font-size:8pt;\">Default is Enabled</span></p></body></html>"))
        self.general_beepOnError_checkBox.setText(_translate("MainWindow", "Beep On Error"))
        self.general_stopOnError_checkBox.setToolTip(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\">Stop the entire testing process if an error occurs. If disabled, the stress test program will be restarted when an error occurs.</span></p><p align=\"center\"><span style=\" font-size:8pt;\">Default is Disabled</span></p></body></html>"))
        self.general_stopOnError_checkBox.setWhatsThis(_translate("MainWindow", "<html><head/><body><p><br/></p></body></html>"))
        self.general_stopOnError_checkBox.setText(_translate("MainWindow", "Stop Test On Error"))
        self.general_assignBothVirtualCoresForSingleThread_checkBox.setToolTip(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\">Use only 1 thread for load generation, but assign that thread to both virtual (logical) cores. This way Windows Scheduler or the internal CPU Scheduler will choose which of both virtual CPUs is used.</span></p><p align=\"center\"><span style=\" font-size:8pt;\">Default is Disabled</span></p></body></html>"))
        self.general_assignBothVirtualCoresForSingleThread_checkBox.setText(_translate("MainWindow", "Assign Both Cores For Single Thread"))
        self.general_flashOnError_checkBox.setToolTip(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\">Flash the window/icon in the taskbar when a core has thrown an error.</span></p><p align=\"center\"><span style=\" font-size:8pt;\">Default is Enabled</span></p></body></html>"))
        self.general_flashOnError_checkBox.setText(_translate("MainWindow", "Flash On Error"))
        self.general_skipCoreOnError_checkBox.setToolTip(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\">If enabled, testing skips a core in the following iterations that has already thrown an error. If this disabled, it will test a core in the next iteration even if it has thrown an error.</span></p></body></html>"))
        self.general_skipCoreOnError_checkBox.setWhatsThis(_translate("MainWindow", "<html><head/><body><p><br/></p></body></html>"))
        self.general_skipCoreOnError_checkBox.setText(_translate("MainWindow", "Skip Core On Error"))
        self.general_lookForWheaErros_checkBox.setToolTip(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\">If this is enabled, CoreCycler will periodicall check the Windows Event Log for WHEA errors. These WHEA errors do not necessarily cause or show up together with a stress test error, but are indicative of an unstable overclock/undervolt. A stable system should not produce any WHEA errors/warnings.</span></p><p align=\"center\"><span style=\" font-size:8pt;\">Default is Enabled</span></p></body></html>"))
        self.general_lookForWheaErros_checkBox.setText(_translate("MainWindow", "Look For WHEA Errors"))
        self.general_restartTestProgramForEachCore_checkBox.setToolTip(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\">Restarts the testing program for each core. For example: if ycruncher is set to run SFT, SFTv4, and SVT, and Core 0 fails the SFTv4 test, the next core will restart ycruncher and will start on the first test (SFT). If this option is disabled, ycruncher will NOT restart, but will continue to the next test (SVT) on the next core.</span></p><p align=\"center\"><span style=\" font-size:8pt;\">For a long-form explanation of this setting, check the box, then press Shift+F1 on your keyboard.</span></p></body></html>"))
        self.general_restartTestProgramForEachCore_checkBox.setWhatsThis(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\">Restart the stress test process when a new core is selected</span></p><p align=\"center\"><span style=\" font-size:8pt;\">This means each core will perform the same sequence of tests during the stress test</span></p><p align=\"center\"><span style=\" font-size:8pt;\">This setting is best combined with runtimePerCore = auto</span></p><p align=\"center\"><span style=\" font-size:8pt;\">Note: The monitor doesn\'t seem to turn off when this setting is enabled</span></p><p align=\"center\"><span style=\" font-size:8pt;\">Important note: One disadvantage of this setting is that it has the potential to limit the amount of tests that the stress test program can run.</span></p><p align=\"center\"><span style=\" font-size:8pt;\">In Prime95 for example, each FFT size will run for roughly 1 minute (except for very small ones), so if you want to make sure that Prime95 runs all of the available FFT sizes for a setting, you\'ll have to extend the &quot;runtimePerCore&quot; setting from the default value to something higher. For example the &quot;Huge&quot;/SSE preset has 19 FFT entries, and tests on my 5900X showed that it roughly takes 13-19 Minutes until all FFT sizes have been tested. The &quot;Large&quot;/SSE seems to take between 18 and 22 Minutes. I\'ve included the measured times in the comment for the &quot;runtimePerCore&quot; setting above. This is why setting runtimePerCore = auto is beneficial when using this setting, to make sure every test is performed for every core. If this setting is disabled, a new core will very likely start with a different test / FFT size than the previous one. For longer testing periods (e.g. over night), the tested FFT sizes / algorithms will even out eventually, but if you want to make sure that each core is tested in exactly the same way, you should enable this setting.</span></p></body></html>"))
        self.general_restartTestProgramForEachCore_checkBox.setText(_translate("MainWindow", "Restart For Each Core"))
        self.general_suspendPeriodically_checkBox.setToolTip(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\">This can simulate load changes / switches to idle and back. Enabling this setting will periodically suspend the stress test program, wait for a bit, and then resume. Your CPU load and Clock Speed should drop significantly while the program is suspended, and then rise again. This will increase the runtime of the various stress tests as seen in the &quot;Runtime Per Core&quot; setting by roughly 10%</span></p><p align=\"center\"><span style=\" font-size:8pt;\">Default is Enabled</span></p></body></html>"))
        self.general_suspendPeriodically_checkBox.setText(_translate("MainWindow", "Suspend Test Periodically"))
        self.general_numberOfThreads_spinBox.setToolTip(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\">Sets the number of threads to use for testing. You can only choose between 1 and 2. If Hyperthreading/SMT is disabled, this will automatically be set to 1. Currently there\'s no automatic way to determine which core has thrown an error. Setting this to 1 causes higher boost clocks due to less heat. </span></p><p align=\"center\"><span style=\" font-size:8pt;\">Default is 1</span></p></body></html>"))
        self.general_numberOfThreads_label.setText(_translate("MainWindow", "Threads"))
        self.general_useConfigFile_lineEdit.setToolTip(_translate("MainWindow", "<html><head/><body><p align=\"center\">When a custom config file is loaded, the name of the config file will be displayed here.</p><p align=\"center\">Press &quot;Load Config&quot; to use some pre-made config files or choose your own settings and press &quot;Save Config&quot; to save your own config file to be loaded at any time.</p></body></html>"))
        self.general_useConfigFile_lineEdit.setPlaceholderText(_translate("MainWindow", "Config File Name"))
        self.configsFolder_toolButton.setToolTip(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\">Open the configs folder and allows you to easily select a pre-defined config file to use for testing. When a config file is selected, the Use Config File checkbox is automatically selected and the config file is ready to be used.</span></p></body></html>"))
        self.configsFolder_toolButton.setText(_translate("MainWindow", "Load Config"))
        self.saveConfig_pushButton.setToolTip(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\">Allows you to save the current settings to a config file. Select the settings you wish to use, click the Apply button, then Save Config. This allows you to create your own custom config files to be easily accessed at any time. If you do not click Apply before saving, the custom config file will not have the correct settings. </span></p></body></html>"))
        self.saveConfig_pushButton.setWhatsThis(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\">CoreCycler uses a config.ini file, which is located in the base directory. The configs folder has pre-made config files that CoreCycler can use for easy and fast access to different testing configurations. The &quot;Save Config&quot; button will take the current config.ini file and save it to the configs folder with a name that you assign to the file. If you change any settings, make sure you press the Apply button before you press Save Config, otherwise the config.ini file will not have the settings you selected. </span></p></body></html>"))
        self.saveConfig_pushButton.setText(_translate("MainWindow", "Save Config"))
        self.general_runtimePerCore_label.setText(_translate("MainWindow", "Runtime Per Core"))
        self.general_runtimePerCore_lineEdit.setToolTip(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\">Sets the runtime per core. You can define a specific runtime per core by entering a numeric value. Accepted values are (h) for hours, (m) for minutes, and (s) for seconds. </span></p><p align=\"center\"><span style=\" font-size:8pt;\">360s or 1h4m or 1.5h</span></p><p align=\"center\"><span style=\" font-size:8pt;\">Default is 6m</span></p></body></html>"))
        self.general_runtimePerCore_lineEdit.setPlaceholderText(_translate("MainWindow", "90s or 1.5m or 1h45m"))
        self.general_maxIterations_label.setText(_translate("MainWindow", "Max Iterations"))
        self.general_maxIterations_spinBox.setToolTip(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\">The max number of iterations. High values are basically unlimited (good for testing overnight).</span></p><p align=\"center\"><span style=\" font-size:8pt;\">Default is 10000</span></p></body></html>"))
        self.general_delayBetweenCores_label.setText(_translate("MainWindow", "Delay Between Cores"))
        self.general_delayBetweenCores_spinBox.setToolTip(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\">Set a delay between the Cores. If the &quot;Restart for Each Core&quot; setting is enabled, this will define the amount of time in seconds between the end of the run for one core and the start of another. If &quot;Restart for Each Core&quot; is Disabled, this setting has no effect. Using this setting may help your CPU to cool down a little between cores, which could result in slightly higher core clock speeds at the start of the test.</span></p><p align=\"center\"><span style=\" font-size:8pt;\">Default is 15</span></p></body></html>"))
        self.general_delayBetweenCores_spinBox.setSuffix(_translate("MainWindow", "s"))
        self.general_coresToIgnore_label.setText(_translate("MainWindow", "Cores To Ignore"))
        self.general_coresToIgnore_lineEdit.setToolTip(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\">Ignore certain cores. Comma separated list of cores that will not be tested. The enumeration of cores starts with 0. For example: 0, 1, 2</span></p><p align=\"center\"><span style=\" font-size:8pt;\">Default is (Empty)</span></p></body></html>"))
        self.general_coresToIgnore_lineEdit.setPlaceholderText(_translate("MainWindow", "0, 1, 6, 9, 12"))
        self.general_coreTestOrder_comboBox.setToolTip(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\">The test order of cores. Default will run Alternate if the CPU has more than 8 cores. Alternate will switch between CCDs, so the test order would be 0, 8, 1, 9, 2, 10, etc.. On a CPU with less than 8 cores, it will run as Random. Or you can manually select if you want Sequential. Setting this value to Custom allows you to manually type in the core test order. If Custom is selected, the test will only run cores typed in the Custom Test Order field. If you set this value to Custom and type in &quot;4, 0&quot; in the Custom Test Order field, the test will only run on cores 4 and 0 for every iteration.</span></p></body></html>"))
