        self.general_coreTestOrder_comboBox.setItemText(3, _translate("MainWindow", "Sequential"))
        self.general_coreTestOrder_comboBox.setItemText(4, _translate("MainWindow", "Custom"))
        self.general_coreTestOrder_label.setText(_translate("MainWindow", "Core Test Order"))
        self.general_coreTestOrder_lineEdit.setToolTip(_translate("MainWindow", "<html><head/><body><p align=\"center\"><span style=\" font-size:8pt;\">This field only applies if Core Test Order is set to Custom. The &quot;Cores To Ignore&quot; setting still takes precedence over any core listed in this field.</span></p><p align=\"center\"><span style=\" font-size:8pt;\">Type in the core test order you wish to use, separted by commas. For example:<br/>2, 2, 4, 6, 6, 1, 3, 5, 7</span></p></body></html>"))
